Step-by-step reasoning:
1. Key psychological mechanisms: Responders’ behavior is influenced by the monetary gain they receive and by how “fair” they feel the offer is relative to what they contributed (compared to the opponent). This fairness perception is captured by comparing the actual offer (split_self) with a fairness benchmark (F), which is computed based on the relative token contributions scaled by the combined earnings.
2. Mechanism interactions: The model assumes that the subjective value of the monetary offer increases nonlinearly (via a logarithmic transformation) with the offered amount. In parallel, a penalty is applied whenever the offer deviates from the fairness benchmark. Importantly, the deviation is normalized by the benchmark so that the penalization reflects proportional differences. This penalty is allowed to be nonlinear in the deviation, with two learnable parameters governing its strength and nonlinearity.
3. Mathematical form: 
 – A fairness benchmark is defined by F = (token_self/(token_self+token_opp))×combined_earning.
 – The absolute discrepancy, normalized by F, is d = |split_self − F|/F.
 – The utility of accepting an offer is then given by a subjective log-value of the monetary offer minus a fairness penalty, where the penalty is modeled as kappa times the logarithm of one plus the discrepancy raised to a power phi.
4. Learnable parameters: 
 – kappa: scales the penalty imposed by deviations from fairness.
 – phi: determines the nonlinearity in how deviations from the fairness benchmark affect utility.
5. Observable behavior mapping: The model produces a utility U_accept for accepting an offer, which will later be mapped to choice probabilities via a temperature parameter (not part of this model). High utility indicates that the offered split is both monetarily attractive and not excessively unfair relative to the participant’s contribution.

Below is the formal specification.

<MODEL>
Let F = (token_self / (token_self + token_opp)) × combined_earning
Let d = |split_self − F| / F
U_accept = ln(split_self) − kappa × ln(1 + d^(phi))
</MODEL>

